import React from 'react';
import { Icon } from '../Icon/Icon';
import { Container, Form, Title, Text, Input, InputWrapper, Textarea, Button } from './BookForm.styled'

export const BookForm = () => {
    return (
      <Container>
        <Form>
          <Title></Title>
          <Text></Text>
<Input />
<Input />
<InputWrapper>
<input />
<Icon />
</InputWrapper>
<textarea></textarea>
<button></button>
        </Form>

      </Container>
    );
  };
